,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,function(e,t,n){var a={react:n(0)},r=n(12).default.bind(null,a);n(13).default.bind(null,"const React$0 = require('react');\nconst React = React$0.default || (React$0['React'] || React$0);",r);e.exports=[{type:"markdown",content:'Here we discuss some general component conventions and best practices.\n\n## Component file header\n\n### File imports\n\nFile imports for each file should appear in the correct order. The order is as follows (each of these blocks should be separated by a blank line):\n\n1) Types from external packages\n\n```js\n<span class="token keyword">import</span> <span class="token punctuation">{</span> FormikProps <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'formik\'</span><span class="token punctuation">;</span>\n```\n\n2) External packages\n\n```js\n<span class="token keyword">import</span> React<span class="token punctuation">,</span> <span class="token punctuation">{</span> Component <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'react\'</span><span class="token punctuation">;</span>\n```\n\n3) Aliased modules / components\n\n```js\n<span class="token keyword">import</span> <span class="token punctuation">{</span> getMainClasses <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'~utils/css\'</span><span class="token punctuation">;</span>\n```\n\n4) Styles\n\n```js\n<span class="token keyword">import</span> styles <span class="token keyword">from</span> <span class="token string">\'./StepCreateToken.css\'</span><span class="token punctuation">;</span>\n```\n\n5) Types of our own libs / files\n\n```js\n<span class="token keyword">import</span> <span class="token punctuation">{</span> SomeTypes <span class="token punctuation">}</span> <span class="token keyword">from</span> \'<span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token operator">/</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token operator">/</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token operator">/</span>lib<span class="token operator">/</span><span class="token operator">...</span><span class="token punctuation">;</span>\n```\n\n6) Our own files\n\n```js\n<span class="token keyword">import</span> Stuff <span class="token keyword">from</span> <span class="token string">\'../../../lib/...\'</span><span class="token punctuation">;</span>\n```\n\n### Internationalization\n\nEvery piece of text / copy has to be used with internationalisation in mind. Never (!) hard code text in the components themselves. The convention is to use a const named `MSG` with `react-intl`s `defineMessages` at the top of the file (directly under the imports):\n\n```js\n<span class="token keyword">const</span> <span class="token constant">MSG</span> <span class="token operator">=</span> <span class="token function">defineMessages</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n  <span class="token comment">/* Messages here */</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n```\n\nThe convention for the `id` naming is the following: `module.ComponentName.[SubComponentName].propertyName` where `propertyName` should be the same name as used for the property in `MSG`. Here\'s an example:\n\n```js\nlabelAddAdmins<span class="token operator">:</span> <span class="token punctuation">{</span>\n  id<span class="token operator">:</span> <span class="token string">\'admin.Organizations.OrganizationAddAdmins.labelAddAdmins\'</span><span class="token punctuation">,</span>\n  defaultMessage<span class="token operator">:</span> <span class="token string">\'Add new admin\'</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">,</span>\n```\n\n**Important! `core`-components do not get a module prefix!** Example:\n\n```js\n<span class="token keyword">const</span> <span class="token constant">MSG</span> <span class="token operator">=</span> <span class="token function">defineMessages</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n  title<span class="token operator">:</span> <span class="token punctuation">{</span>\n    id<span class="token operator">:</span> <span class="token string">\'ColonyGrid.title\'</span><span class="token punctuation">,</span>\n    defaultMessage<span class="token operator">:</span> <span class="token string">\'Colonies\'</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n```\n\nAlso do not use sub-sub-component names or anything like that. The `ComponentName` is always the one of the main component (the directory name) and the `SubComponentName` is the name of the current component (the current file). `SubComponentName` is only applied in sub-components (the ones which have a different name from the main one).'}]},,function(e,t,n){"use strict";var a=this&&this.__importDefault||function(e){return e&&e.__esModule?e:{default:e}};Object.defineProperty(t,"__esModule",{value:!0});const r=a(n(1649)).default();t.default=r},,,,,,,,function(e,t){},,function(e,t){},,,,,,,,,,,,,function(e,t){},,function(e,t){},function(e,t){},,,,,,,,,,,,,,,,,,,function(e,t){},,function(e,t){},,,,,,,,,,,,,,,,,,,,,,,,,,,,,,function(e,t){},,,,,,,,,,,,,,,,,,,,function(e,t){},,function(e,t){},,,,,,function(e,t){},function(e,t){},,,function(e,t){},,,,,,,,,,,,,,,,function(e,t){},,,fun